import Header from "./Header";
import "./App.css";
import Home from "./Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Router path="/checkout">
            <Header />
            <h1>you are in checkout page</h1>
          </Router>

          <Router path="/">
            <Header />
            <Home />
          </Router>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
